import React, {Component} from 'react';
import classes from './SpectreTopBar.css';
import Radium from 'radium';
import spectreVide from '../../../assets/spectreVide.jpg';
import { Icon } from 'react-icons-kit';
import {caretUp} from 'react-icons-kit/fa/caretUp'

let fleche = null;



class SpectreTopBar extends Component {
  style1 = {visibility: 'hidden'}
  style2 = {visibility: 'hidden'}
  style3 = {visibility: 'hidden'}
  style4 = {visibility: 'hidden'}
  style5 = {visibility: 'hidden'}
  style6 = {visibility: 'hidden'}
  style7 = {visibility: 'hidden'}
  style8 = {visibility: 'hidden'}
  style9 = {visibility: 'hidden'}
  style10 = {visibility: 'hidden'}
    render() {
      if (this.props.SpectreTopBar === 1)
        style1 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 2)
        style2 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 3)
        style3 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 4)
        style4 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 5)
        style5 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 6)
        style6 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 7)
        style7 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 8)
        style8 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 9)
        style9 = {visibility: 'visible'}
      else if (this.props.SpectreTopBar === 10)
        style10 = {visibility: 'visible'}

      fleche = (
        <div className={classes.spectreTool}>
          <div className={classes.fleche} style={style1}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style2}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style3}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style4}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style5}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style6}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style7}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style8}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style9}>
            <Icon icon={caretUp} size={20}/>
          </div>
          <div className={classes.fleche} style={style10}>
            <Icon icon={caretUp} size={20}/>
          </div>
        </div>
      )

      return (        
        <div className={classes.SpectreTopBar}>
          <div className={classes.spectreImg}>
            <img src={spectreVide} alt="vide" className={classes.image} />
          </div>
            {fleche}
        </div>
      );
    }
  }

export default Radium(SpectreTopBar);
